import Footer from "../components/Footer";

export default function Blog() {
  return (
    <div>
      <NavigationBar />
      <h1>Blog</h1>
      {/*blog cards that re-direct to single blog article */}
      <div>Blog card</div>
      <Footer />
    </div>
  );
}
